import { Component } from '@angular/core';

@Component({
  selector: 'app-body',
  templateUrl: './body.component.html',
  styleUrls: ['./body.component.css']
})
export class BodyComponent {

  title = "This is Devtown Webpage"
  keyupfun(e: any) {
   this.title= e.target.value
  }
}
